import NavBar from './components/NavBar';
import './Home.css'; 
import restinicial from './assets/restinicial.jpg'; 

const Home = () => {
    return (
        <div>
            <NavBar />
            <h1>teste</h1>
            <div>
                <img src={restinicial} alt="sala do restaurante" />
            </div>

        </div>
    );
};

export default Home;
